import React, { Component } from "react";
import { Menu, Icon } from "semantic-ui-react";
import { Link } from "../routes";

export default () => {
    return (
        <Menu style = {{ marginTop: "10px" }} >
            <Link route = "/">
                <a className = "item">
                    CrowdCoin
                </a>
            </Link>
            <Menu.Menu position = "right">
                <Link route = "/">
                    <a className = "item">
                        Campaigns
                    </a>
                </Link>
                <Link route = "/campaigns/new">
                    <a className = "item">
                    <Icon name='plus' />
                    </a>
                </Link>
            </Menu.Menu>
        </Menu>
    );
}
